import React from 'react'
import Navbar from '../components/Navbar'
import Footer from '../components/Footer'
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import { useContext } from 'react'
import { UserContext } from '../App';
import Button from '@mui/material/Button';






function DragExercises() {

  const handleClick = () =>  {}

  const {list, setList} = useContext(UserContext);

  return (
    <>
    <Navbar/>
    <Container maxWidth="1600" 
    sx={{
      display: 'flex',
      flexDirection: 'column',
      height: 'auto',
    }}>
      <Box sx={{ 
        padding: '1em',
        display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      width: 'auto'
        }}>
          <Typography sx={{ 
            fontFamily: 'Shadows Into Light, cursive', 
            fontSize: '3em', 
            fontWeight: '400',
            marginTop: '1.5em',
            color: 'primary.dark',
            marginBottom: '0.5em',
            }}>
              Drag exercises</Typography>

              <Container maxWidth='1600' className='containerAllUls' 
              sx={{display: 'flex',
                flexDirection: 'column',
                overflow: 'hidden',
                padding: '1em'}}>
                  <Box className='containerMovementButtons' 
              sx={{display: 'flex',
                flexDirection: 'row',
                flexWrap: 'wrap',
                marginBottom: '2em',
                padding: '0em 0em 2.3em 2.3em'}}>
                {Object.keys(list).map(movement => 
              <React.Fragment key={movement + "Fragment"}>
                {list[movement]
                    .map((exercise, index) => exercise.isClicked && 
                    <Button className='buttonIndividualExercise' 
                    key={exercise.title}
                    id={exercise.title}
                    sx={{
                      fontFamily: 'Lato, sans-serif',
                      fontSize: '1em',
                      backgroundColor: exercise.isClicked
                      ? 'rgb(15, 175, 15)'
                      : '#90caf9',
                      color: exercise.isClicked
                      ? '#fff'
                      : '#000',
                      borderRadius: '15px',
                      padding: '1em',
                      width: '10em',
                      boxShadow:  '10px 5px 10px rgba(0, 0, 0, 0.3)',
                      marginTop: '1em',
                      marginRight: '1em',
                      transition: '0.3s',
                      cursor: 'pointer',
                      '&:hover': { 
                        backgroundColor: '#bdb9b7',
                    },
                    }}
                      onClick={handleClick
                       }>
                        {exercise.title}</Button>)}
                  </React.Fragment>)}

                  </Box>
              </Container>

              </Box>
        </Container>
    <Footer/>
    </>
  )}


export default DragExercises
